// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AssignmentRegistry {
    struct Assignment {
        uint256 id;
        string task_name;
        uint256 status;
        uint256 due;
        uint256 project;
        uint256[] assign;
    }

    Assignment[] public assignments;

    function addAssignment(
        uint256 _id,
        string memory _task_name,
        uint256 _status,
        uint256 _due,
        uint256 _project,
        uint256[] memory _assign
    ) public {
        assignments.push(Assignment(_id, _task_name, _status, _due, _project, _assign));
    }

    function getAssignment(uint256 _index) public view returns (Assignment memory) {
        require(_index < assignments.length, "Index out of bounds");
        return assignments[_index];
    }

    function getAssignmentsCount() public view returns (uint256) {
        return assignments.length;
    }
}
